import React, {Component} from 'react';
import Navbar from './Navbar';

class About extends Component {
    render() {
        return (
            <div> 
                <Navbar page="about"/>
                <h1 className="aboutHeader"> About Me </h1>

            </div>
        );
    }
}

export default About;
